import {React, useState, useEffect} from "react";
import ReverseMd5 from "reverse-md5";
import styles from "./profile.module.css";

const AssessmentProfile = ({candidateName = 'candidate'}) => {

  const [assessmentSession, setAssessmentSession] = useState({});
  const [candidate, setCandidate] = useState({});

  useEffect(() => {
      let href = window.location.href;
      let md5Hash = href.substring(href.indexOf('uid=')+4,href);
      var rev = ReverseMd5({
          lettersUpper: false,
          lettersLower: true,
          numbers: true,
          special: false,
          whitespace: true,
          maxLen: 12
      });
      var decoded = rev(md5Hash);
      console.log('--decoded: ', decoded);
    }, []);

  return (
  <div/>);
}
export default AssessmentProfile;
